export const filterCities = (inputValue) => {
  const rgx = new RegExp(`_${inputValue}[^_]*`, "gim");

  let results = longCities.match(rgx);

  if (results) {
    results = results.map((city) => {
      return city.slice(1);
    });
  }

  return results
    ? [...new Set(results.sort((a, b) => (a.length > b.length ? 1 : -1)))]
    : ["No cities"];
};
